import { useContext, useEffect, useState } from "react";
import { db } from "../../../firebaseConfig";
import { getDocs, collection, query, where, doc, getDoc } from "firebase/firestore";
import { AuthContext } from "../../../context/AuthContext";
import {
  Card,
  CardContent,
  CardMedia,
  Typography,
  Grid,
  Divider,
  Box,
  Stack,
  Button,
} from "@mui/material";
import { format } from "date-fns";
import { es } from "date-fns/locale";
import { jsPDF } from "jspdf";
import autoTable from "jspdf-autotable";
import "./useStyles.css";

// Aqu√≠ debes colocar tu imagen en base64
const imageUrlBase64 = "data:image/png;base64,";
// Reemplaza la URL base64 de arriba con tu imagen en base64

const UserOrders = () => {
  const [myOrders, setMyOrders] = useState([]);
  const { user } = useContext(AuthContext);

  useEffect(() => {
    if (user && user.email) {
      const fetchOrders = async () => {
        try {
          const ordersCollection = collection(db, "orders");
          const ordersFiltered = query(
            ordersCollection,
            where("email", "==", user.email)
          );
          const querySnapshot = await getDocs(ordersFiltered);
          const ordersWithImages = await Promise.all(
            querySnapshot.docs.map(async (order) => {
              const data = order.data();
              const itemsWithImages = await Promise.all(
                data.items.map(async (item) => {
                  const productDoc = await getDoc(doc(db, "products", item.id));
                  return { ...item, image: productDoc.data().image };
                })
              );
              return {
                ...data,
                id: order.id,
                date: data.date ? data.date.toDate() : null,
                items: itemsWithImages,
              };
            })
          );

          // Ordenar las √≥rdenes por fecha
          ordersWithImages.sort((a, b) => b.date - a.date);

          setMyOrders(ordersWithImages);
        } catch (error) {
          console.log(error);
        }
      };

      fetchOrders();
    }
  }, [user]);

  const generateOrderPDF = async (order) => {
    const doc = new jsPDF();

    const imageWith = 30
    const imageHeight = 30

    // Agregar imagen al PDF (arriba a la izquierda)
    doc.addImage(imageUrlBase64, "JPEG", 10, 10, imageWith, imageHeight);

    const initialTextYPosition=50

    // T√≠tulo del documento
    doc.setFontSize(18);
    doc.setTextColor(40);
    doc.text("Detalles de la Orden", 105, initialTextYPosition, { align: "center" });

    // Informaci√≥n de la orden
    doc.setFontSize(12);
    doc.text(`ID de la Orden: ${order.id}`, 20, initialTextYPosition + 10);
    doc.text(`Fecha de la Orden: ${order.date ? format(order.date, "PPPP p", { locale: es }) : "No disponible"}`, 20, initialTextYPosition + 20);
    doc.text(`Correo Electr√≥nico: ${order.email}`, 20, initialTextYPosition + 30);

    // Espacio para la tabla
    const head = [['Producto', 'Cantidad', 'Precio Unitario', 'Subtotal']];
    const body = order.items.map((item) => [
      item.title,
      item.quantity,
      `$${item.unit_price.toFixed(2)}`,
      `$${(item.unit_price * item.quantity).toFixed(2)}`,
    ]);

    body.push([
      { content:"Total", colSpan: 3, styles:{halign:"right",fillColor:[255,255,255], textColor:[0,0,0]}},
      `$${order.total.toFixed(2)}`
    ])

    // Configuraci√≥n y generaci√≥n de la tabla
    autoTable(doc, {
      head,
      body,
      startY: initialTextYPosition + 40,
      styles: {
        halign: 'center',
        valign: 'middle',
        fontSize: 10,
      },
      headStyles: {
        fillColor: [0, 0, 255],
        textColor: [255, 255, 255],
      },
      columnStyles: {
        0: { halign: 'left' }, // Nombre del producto alineado a la izquierda
        3: { halign: "right"}
      },
      footStyles: {
        fillColor:[255,255,255],
        textColor:[0,0,0],
        fontSize:12,
        fontStyle:"bold"
      }
    });



    // Total de la orden
    //doc.setFontSize(14);
    //doc.setTextColor(40);
    //doc.text(`Total de la Orden: $${order.total.toFixed(2)}`, 20, doc.lastAutoTable.finalY + 10);

    // Descargar el PDF
    doc.save(`order_${order.id}.pdf`);
  };

  return (
    <Box className="container">
      <Typography className="title" variant="h4" gutterBottom>
        Mis Compras
      </Typography>
      <Grid container spacing={3}>
        {myOrders.map((order) => (
          <Grid item xs={12} key={order.id}>
            <Card className="card">
              <CardContent>
                {order.date && (
                  <Typography className="date" variant="subtitle2" color="textSecondary" gutterBottom>
                    Fecha de compra: {format(order.date, "PPPP p", { locale: es })}
                  </Typography>
                )}
                <Divider />
                {order?.items?.map((product) => (
                  <Stack
                    key={product.id}
                    direction="row"
                    spacing={12}
                    alignItems="center"
                    className="product-details"
                  >
                    <CardMedia
                      className="product-image"
                      component="img"
                      image={product.image} // Aseg√∫rate de que cada producto tenga una propiedad 'image'
                      alt={product.title}
                    />
                    <Box className="product-info">
                      <Typography className="product-title" variant="body1">
                        {product.title}
                      </Typography>
                      <Typography className="product-quantity" variant="body2">
                        Cantidad: {product.quantity}
                      </Typography>
                    </Box>
                    <Typography className="product-price" variant="body2">
                      ${product.unit_price}
                    </Typography>
                  </Stack>
                ))}
                <Divider />
                <Box className="total">
                  <Typography variant="subtitle1">
                    Total de la orden: ${order.total}
                  </Typography>
                </Box>
                <Button 
                  variant="contained" 
                  color="primary" 
                  onClick={() => generateOrderPDF(order)}
                  sx={{ mt: 2 }}
                >
                  Descargar voucher
                </Button>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default UserOrders;
